import './index.css';
import React from 'react'

export default class Footer extends React.Component {
    render() {
        const {todos} = this.props
        const doneLength = todos.filter((item)=>{
            item.flag === true
        }).length
        return (<div>
                  <input type ='radio'/> 

                  Done {doneLength}/{todos.length}
                </div>)
    }
}
